import React from 'react'

const Test = () => {
    const [itemsArr, setItemsArr] = (['Thing 1 ', 'Thing 2 '])
    function addItems(){
        setItemsArr(prevArr =>{
            return [...prevArr, ` Thing  ${prevArr.length + 1}`]
        })
    }
  return (
    <div>
        <h1 className='add' onClick={addItems}>
            addItems
        </h1>
        <p key={itemsArr}>{itemsArr}</p>
    </div>
  )
}

export default Test
